- input: "TEXT\x1CC00024372\x1CTEXT-00002\x1C\x1CF3XA\x1CThis Amendment is being filed
    in response to the Commission's request, dated February 22, 2008.    All issues
    have been addressed and are listed here in the same order as the requestion for
    additional information from the Commission.    1.  The receipts from Federal Candidate
    Committee on Schedule A, supporting Line 11(c), were transfers and have now been
    labeled as such.    2.  The voided checks on Line 29 did not constitute in-kind
    contributions. They were two mis-reported transfers and two non federal direct
    contributions.  Neither situation would require the reissue of a check or inkind
    from these voids.     3.  The inkinds from the Democratic National Committee for
    On-Line Voter File Access In-Kind were ofset on Schedule B by the inkinds from
    the Voter Activation Network.     4.  This report does not report any payroll
    related expenses on Line 30(b) because no employee spent over 25% of thier compensated
    time on Federal activity.    5.  Our records indicate that the H3 transfers for
    JJ Dinner 05-2007 actually fall short of the maximum transfers available.  The
    majority of the transfers made were from transaction within the transfer window,
    but outside the current reporting period.     6.  The Advertisement related expenses
    on Schedule H4 were for generic and general Party advertisements. They did not
    solicite funds nor did they mention a federal candidate. These transactions were
    also outside of the FEA window.     7.  The year to date totals on Schedule H4
    now appear to be correct.    8.  All vendors listed on Schedule H4 now have complete
    information.    9.  The voided transaction on Schedule H4 were voided for several
    reasons, primarily for situations were a duplicate or unessisary payment was made.
    \ In all cases, payment was not due, and because of that, no re-issue is require,
    nor does an inkind result from the voiding of these transactions.      10.  The
    discriptions for payments listed on Schedule H4 have been clarified.     11.  The
    payment to Bylites on Schedule H4 appears to have been coded to the incorrect
    category. It has been corrected.    12.  The Committee did not use the funds from
    the DNC to pay for exempt activity.  The Committee verified this using the first
    in, first out method.  Furthermore, the Committee had far more permissible funds
    available at the time these transactions were made.     13.  The transactions
    for Survey Research and Voter File Disk listed on Schedule H4 did not promote,
    support, attack or oppose a federal candidate."
